webpackJsonp([20100764705179],{458:function(e,n){e.exports={data:{markdownRemark:{html:'<p>Keytool is a tool used to manage java keystores. It allows to do the following:</p>\n<ul>\n<li>listing keystore contens</li>\n<li>changing (add/remove) keys and certificates</li>\n<li>generating keys and key pairs</li>\n</ul>\n<p>Help command is just</p>\n<pre><code class="language-bash">keytool -h\n</code></pre>\n<p>Command to generate a key pair:</p>\n<pre><code class="language-bash">keytool -genkeypair -alias myalias -keyalg RSA -keysize 2048 -validity 730 -keystore ownjavakeystore.jks\n</code></pre>\n<pre><code class="language-bash"></code></pre>\n<pre><code class="language-bash"></code></pre>\n<pre><code class="language-bash"></code></pre>',frontmatter:{title:"Keytool",date:"April 28, 2024",path:"/keytool",tags:["java","security","tls","ssl","keytool"],excerpt:""}}},pathContext:{prev:{html:'<h2>Goals</h2>\n<pre><code class="language-zsh">mvn clean\n</code></pre>\n<pre><code class="language-zsh">mvn package\n</code></pre>\n<p>To display a POM that includes all of the inherited properties, execute:</p>\n<pre><code class="language-zsh">mvn help:effective-pom\n</code></pre>\n<h2>Dependency Scope</h2>\n<ul>\n<li>Compile: Default. Available on all classpaths of project. Also, propagated to downstream projects.</li>\n<li>Provided: Like Compile, but expected to be provided by JDK or container at runtime.</li>\n<li>Runtime: Not required for compile, but needed for runtime. On runtime and test classpaths, not compile.</li>\n<li>Test: Only available on test classpath, not transitive.</li>\n<li>System: similar to provided, but jar is added to system explicitly (via file path)</li>\n<li>Import: imports dependency of POM</li>\n</ul>\n<h4>Dependency plugin goals</h4>\n<ul>\n<li>dependency:tree</li>\n<li>dependency:go-offline</li>\n<li>dependency:purge-local-repository</li>\n<li>dependency:sources</li>\n</ul>\n<h2>Maven Build Lifecycles</h2>\n<p>Maven is based on the concept of build lifecycles.\nA licecycle is a pre-defined group of build steps called <strong>phases</strong>.\nEach phase can be bound to one or more plugin <strong>goals</strong>.\nAll work done in Maven is done by plugins.\nLifecycles and phases provide the framework to call plugin goals in a sequence.</p>\n<p>There are three pre-defined lifecycles:</p>\n<ul>\n<li>clean</li>\n<li>default: does the build and deployment of the project. It is defined without plugin bindings, bindings are defined for each packaging. The default lifecycle include the phases but a number of them are not mentioned: validate, compile, test, package, verify, install and deploy.</li>\n<li>site: least used in practice</li>\n</ul>\n<p>For instance phases of the default lifecycle involved in the case of a jar\npackaging are the following:</p>\n<ul>\n<li>process-resources (maven-resources-plugin: resources)</li>\n<li>compile (maven-compiler-plugin: compile)</li>\n<li>process-test-resources (maven-compiler-plugin: testResources)</li>\n<li>test-compile (maven-compiler-plugin: testCompile)</li>\n<li>test (maven-surefire-plugin: jar)</li>\n<li>package (maven-jar-plugin: jar)</li>\n<li>install (maven-install-plugin: install)</li>\n<li>deploy (maven-deploy-plugin: deploy)</li>\n</ul>\n<h2>Maven configuration â€” <code>settings.xml</code></h2>',id:"C:/Users/nicolas.peron/github.com/nperon/workshop/src/pages/2022-08-27-maven/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2022-08-27T00:47:00.342Z",path:"/maven",title:"Maven",excerpt:"",tags:["maven","devops","continuous integration","build","java","kotlin"]}},next:{html:'<h2>Github repository settings</h2>\n<p>Documentation on <a href="https://docs.github.com/en/actions/monitoring-and-troubleshooting-workflows/enabling-debug-logging">Debug logging</a></p>\n<p><code>ACTIONS_RUNNER_DEBUG</code>: boolean<br>\n<code>ACTIONS_STEP_DEBUG</code>: boolean  </p>\n<h2>Environment variables available in github actions:</h2>\n<p><code>$GITHUB_SHA</code><br>\n<code>$GITHUB_REPOSITORY</code><br>\n<code>$GITHUB_WORKSPACE</code>  </p>\n<p>Exhaustive list of github actions environement variables is\navailable at <a href="https://docs.github.com/en/actions/learn-github-actions/environment-variables">this link</a></p>',id:"C:/Users/nicolas.peron/github.com/nperon/workshop/src/pages/2022-07-15-github/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2022-07-15T14:24:43.180Z",path:"/github",title:"Github",excerpt:"Github",tags:["github"]}}}}}});
